import React from "react";

function DestItem({ image, name }) {
  return (
    <div className="destItem">
      <div 
        style={{ 
          backgroundImage: `url(${image})`,
          zIndex: 1,
          position: "relative"
        }}
      >
        <button 
          className="destText"
          style={{ 
            position: "relative",
            zIndex: -1
          }}
        >
          {name}
        </button>
      </div>
    </div>
  );
}

export default DestItem;
